import React from "react";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import QuoteForm from "./QuoteForm";
import Preview from "./Preview";  // 대문자 P

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<QuoteForm />} />
        <Route path="/Preview" element={<Preview />} />  {/* 대문자 P */}
      </Routes>
    </BrowserRouter>
  );
}


export default App;
